import React from "react";

function Footer() {
	return <div style={styles.header}></div>;
}

export default Footer;

const styles = {
	logo: {
		display: "block",
		float: "bottom",
	},
	header: {
		display: "block",
		float: "top",
		background: "#00193d",
		padding: "0",
		height: "160px",
	},
};
